import React from 'react'
import Header from '../header/Header'

import { motion } from 'framer-motion'

const Home = ({ languages }) => {
  return (
    <motion.div 
    initial={{y: "100%"}}
    animate = {{y: "0%"}}
    exit= {{opacity:1}}
    transition ={{ duration: 0.90, ease:"easeOut"}}>
            <Header languages={languages} />
    </motion.div>
  )
}

export default Home
